export default (state, action) => {
	switch (action.type) {
		case 'INIT_SCHEDULE':
      return {schedule: [], textError: '', loadingFlag: false};

		case 'LOAD_SCHEDULE':
			return {schedule: [], textError: '', loadingFlag: true};

		case 'LOAD_SCHEDULE_FAILURE':
			return {schedule: [], textError: action.payload, loadingFlag: false};

		case 'LOAD_SCHEDULE_SUCCESS':
			return {schedule: action.payload, textError: '', loadingFlag: false};

		case 'RESET_SCHEDULE':
			return {schedule: [], textError: '', loadingFlag: false};

		default:
      return {schedule: [], textError: '', loadingFlag: false};
	}
};
